<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00144
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 synthase - 1 and - 2 are localized to mitochondria-associated membranes . We report the subcellular localization of enzymes involved in phosphatidylserine biosynthesis in mammalian cells . Several lines of evidence suggest that phosphatidylserine synthase - 1 ( PSS 1 ) is highly enriched in mitochondria-associated membranes ( MAM ) and is largely excluded from the bulk of the endoplasmic reticulum ( ER ) . Taking advantage of the substrate specificity of PSS 1 , we showed that ( i ) MAM contain choline exchange activity , whereas this activity is very low in the bulk of the ER , ( ii ) serine exchange activity is inhibited by choline to a much greater extent in MAM than in ER , and ( iii ) MAM use phosphatidylcholine and phosphatidylethanolamine as substrates for phosphatidylserine biosynthesis , whereas the ER utilizes only phosphatidylethanolamine . According to immunoblotting of proteins from both CHO - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04264
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cells and murine liver , PSS 1 is localized to MAM , and in hepatoma cells stably expressing PSS 1 this protein is highly enriched in MAM . Since the ER contains serine and ethanolamine exchange activities , we had predicted that Q9BVG9 would account for the serine exchange activity in the ER . Unexpectedly , using immunoblotting experiments , we found that ( i ) Q9BVG9 of CHO - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04264
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cells is present only in MAM and ( ii ) Q9BVG9 is restricted to MAM of McArdle cells expressing recombinant Q9BVG9 . These data leave open the question of which enzyme imparts PSS activity to the ER and suggest that a third isoform of PSS might be located in the ER .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Modeling of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and inhibition mechanism of the natural ligand , ellagic acid , using molecular docking . Diabetes mellitus is a disorder in which blood sugar ( glucose ) levels are abnormally high because the body does not produce enough insulin to meet its needs . Post-prandial hyperglycemia ( PPHG ) is an independent risk factor for the development of macro vascular complications . It is now recognized that normalizing post-prandial blood glucose is more difficult than normalizing fasting glucose . DB01345 channels are the most widely distributed type of ion channel and are found in virtually all living organisms . The function of KATP channels is best understood in pancreatic beta cells , the membrane potential of which is responsive to external glucose concentration . Beta cells show a remarkably complex electrical bursting behavior in response to an increase in glucose level . DB00731 and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 are a class of insulin secretagog agents that lowers blood glucose levels by stimulating insulin secretion from the pancreas . These compounds interact with the DB00171 - sensitive potassium ( K + DB00171 ) channel in pancreatic beta cells . However , the side effects of these drugs overpass their uses , and the need to identify compounds with less adverse effects is exigent . In our research study , we used the natural compound ellagic acid , which is an already proven anti-carcinogen , anti-mutagen , and anticancer initiator , for its anti-diabetic activity in comparison to the two commercial drugs ( DB00731 and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) . The drugs and the compounds were docked to the DB00171 - dependent potassium channel and their energy value showed that the compound had higher binding value than the commercial drugs . Then an ADME / Tox analysis for the compound was carried out which showed that ellagic can be a possible lead molecule .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Antivascular agents for non-small-cell lung cancer : current status and future directions . BACKGROUND : Despite improvements in surgery and chemo ( radio ) therapy which have allowed for modest advances in the treatment of patients with non-small-cell lung cancer ( NSCLC ) , survival remains poor and further improvements are needed . Attention over recent years has focused , therefore , on targeted therapies , with notable success in the development of antivascular drugs . OBJECTIVE : To summarize the current knowledge on antivascular therapy in patients with NSCLC . METHOD : Review of randomized controlled trials exploring treatment of NSCLC patients with antivascular drugs . RESULTS / CONCLUSION : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00112
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , a humanized monoclonal antibody against the vascular endothelial growth factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , when added to cytotoxic chemotherapy , was the first treatment to prolong the overall survival of patients with advanced NSCLC beyond 12 months , a significant breakthrough in the management of advanced NSCLC . Small-molecule tyrosine kinase inhibitors and alternative antivascular strategies such as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - trap and vascular disrupting agents are also being investigated and have shown promise in clinical trials . This review summarizes the most recent and important findings in antivascular agents in NSCLC .</div>

 pathogenesis has been derived through study of its familial forms ; in particular , through study of autosomal dominant mutations in the

 cases . Under conditions of excessive stress , arimoclomol induces amplification of the cytoprotective heat shock response in order to protect motor neurons from death . Comprehensive in vivo and in vitro studies demonstrated its effect in the prevention of neuronal loss and promotion of motor neuron survival , even after symptom onset . Clinical trials have reported good tolerability and safety . This paper discusses the rationale for arimoclomol use in

<h2 style="margin: 0">14</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Drug insight : Use of docetaxel in prostate and urothelial cancers . Taxanes have emerged as a potent class of chemotherapeutic agents in many malignancies , with two taxanes now in clinical use . Their mechanism of action against tumor cells is by alteration of microtubule dynamics , which causes cell-cycle arrest during mitosis . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01248
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 binds to the microtubules with a higher affinity than paclitaxel , and over a broader range of cell-cycle activities . It has also been shown to promote apoptosis via 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10415
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 phosphorylation . In hormone-refractory prostate cancer , docetaxel has been studied as both a single agent and in combination with estramustine , and in different treatment schedules , with demonstrated efficacy . Two phase III trials have confirmed a survival benefit , making docetaxel the first chemotherapy agent with proven efficacy against prostate cancer . In urothelial cancer , docetaxel has demonstrated activity and has been investigated as a single agent and in combination regimens . A phase III trial comparing docetaxel and cisplatin to methotrexate , vinblastine , doxorubicin , and cisplatin was inferior when evaluating response rates and overall survival . More recent phase II trials combining docetaxel with two additional agents have shown promise , but confirmatory trials are needed .</div>

 - G85R mice , but fell to ~ 50 % in symptomatic mice . The number of large diameter ( ≥ 4 μm ) axons in the

<div class="entities" style="line-height: 2.5; direction: ltr">DB00741 response to stress is associated with myocardial remodeling in salmonid fishes . Cardiac disease is frequently reported in farmed animals , and stress has been implicated as a factor for myocardial dysfunction in commercial fish rearing . DB00741 is a major stress hormone in teleosts , and this hormone has adverse effects on the myocardium . Strains of rainbow trout ( Oncorhynchus mykiss ) selected for divergent post-stress cortisol levels [ high responsive ( HR ) and low responsive ( LR ) ] have been established as a comparative model to examine how fish with contrasting stress-coping styles differ in their physiological and behavioral profiles . We show that the mean cardiosomatic index ( CSI ) of adult HR fish was 34 % higher than in LR fish , mainly because of hypertrophy of the compact myocardium . To characterize the hypertrophy as physiological or pathological , we investigated specific cardiac markers at the transcriptional level . HR hearts had higher mRNA levels of cortisol receptors ( MR , GR1 and GR2 ) , increased P53805 levels [ suggesting enhanced pro-hypertrophic nuclear factor of activated T-cell ( NFAT ) signaling ] and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 gene expression ( reflecting increased angiogenesis ) . Elevated collagen ( Col 1a2 ) expression and deposition in HR hearts supported enhanced fibrosis , whereas the heart failure markers 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01160
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and DB04899 were not upregulated in HR hearts . To confirm our results outside the selection model , we investigated the effect of acute confinement stress in wild-type European brown trout , Salmo trutta . A positive correlation between post-stress cortisol levels and CSI was observed , supporting an association between enhanced cortisol response and myocardial remodeling . In conclusion , post-stress cortisol production correlates with myocardial remodeling , and coincides with several indicators of heart pathology , well-known from mammalian cardiology .</div>

</mark>
 ( OLO ) , a substituted purine analogue , is a much weaker inhibitor of cyclin-dependent kinases than other closely related DB00171 derivatives . It has been recently reported that OLO did not affect the viability of normal human MRC - 5 fibroblasts , but it inhibited the proliferation of human HL - 60 leukemia cells . Therefore , it was interesting to explore the antiproliferative effect of OLO and to characterize its action on distinct human cancer cells differing in the functional status of the cell cycle . Human HeLa cervical carcinoma and HL - 60 leukemia cells were continuously exposed to increasing concentrations of OLO for 24 h and 48 h or alternatively , cells after treatment for 24 h were postincubated in a drug-free medium . Surprisingly , OLO more strongly affected the proliferation of HL - 60 cells than that of HeLa cells . Flow cytometric analyses revealed that OLO at higher doses increases the frequency of a hypoploid HL - 60 cell population representing cells undergoing apoptosis . These results substantiated the data of the determination of the number of viable cells . Moreover , OLO at higher doses modulates the cell cycle progression of tested cancer cells . Detailed analyses of the DNA concentration in single cells revealed that OLO-mediated reduction of the number of G ( 1 ) - phase cells was accompanied by an increase of the frequency of G ( 2 ) - phase cells . The kinetics of these changes differed between both tested cancer cell lines , suggesting that some cancer cells exhibit increased susceptibility to OLO action . It remains to clarify whether the strong proapoptotic effect of OLO observed in HL - 60 cells depends on their differentiation status .</div>
